INSERT INTO `config` VALUES (1, 'logo.gif', 'ร้านค้า,Somsak2004,S-Shop,ร้านค้าออนไลน์,แบบกะดิน,แจกฟรี,ขายสินค้า,ภาษาไทย,E-Commerce', 'โปแกรม S-Shop (16 ธันวาคม 2551) โปรแกรมจาก www.somsak2004.com', 'S-Shop ร้านค้าออนไลน์ โดย Somsak2004', 'โปรแกรม S-Shop โดย <a href="http://www.somsak2004.com" Title="ไปเว็บไซต์ Somsak2004" target="_blank">Somsak2004</a> สงวนลิขสิทธิ์ พศ.2552', 'Somsak2004', 'S-Shop ร้านค้าออนไลน์', 'www.somsak2004.com', '086-812-7839', 'sanma2001@hotmail.com', 'admin', 'admin', 4, 10, '<FONT color=#6633cc size=6>\r\n<P align=center><U><FONT color=#00ff00 size=7><STRONG>ยินดีต้อนรับสู่ S-Shop</STRONG></FONT></U></P>\r\n<P align=center><STRONG>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</STRONG> <FONT color=#0000ff size=4>โปรแกรม S-Shop ย่อมากจาก Somsak2004 Shop เป็นร้านค้าออนไลน์ภาษาไทย โดย Somsak2004 แห่ง </FONT><A href="http://www.somsak2004.com/"><FONT size=4>http://www.Somsak2004.com</FONT></A><FONT color=#0000ff size=4> โดยเป็นโปรแกรม สำหรับคนไทยแจกฟรีให้ใช้โดยมีเงื่อนไข ต้องมี Tag Link ไปยังหน้าเว็บ Somsak2004 ท่านจะใช้ได้โดยไม่ต้องเสียค่าใช้จ่าย หากจะเอา Tag link ออกกรุณาติดต่อเว็บเจ้าของโปรแกรม โดย S-Shop นี่จะเป็นโปรแกรมสำเร็จรูปขั้นพื้นฐาน เน้นเปิดร้านค้าที่ให้ท่านสามารถใช้ร้านค้าขายของได้จริงๆโดยสินค้าจะเป็นการส่งให้ทาง EMS มีระบบตรวจสอบกับทาง บริษัท ไปรษณีไทย จำกัดได้โดยตรงโดยไม่ต้องกรอกเลข EMS (สำหรับลูกค้า) มีระบบแจ้งการโอนเงิน สามารถตรวจสอบคำสั่งซื้อปรับสถานะ ระบบจะแจ้งเมล์อัตโนมัติ ให้ทางลูกค้า เหมาะกับรานพวกขายของที่สามารถส่ง EMS ให้เงินสะพัดในประเทศ ใช้งานง่ายด้วยระบบภาษาไทยทั้งระบบ สามารถออกแบบหน้าเว็บเอง แก้ไขโดยใช้โปรแกรม Front Page หรืออื่นๆเปิดไฟล์แล้วแก้ไขหน้าตา เติมรูปหรืออื่นๆได้ตามใจชอบ คุณสามารถให้ร้านเพิ่มความสามารถอื่นๆได้โดยติดต่อเจ้าของโปรแกรมได้</FONT></P></FONT>', '<P><FONT color=#009900 size=4><STRONG>ยินดีต้อนรับสู่ร้านค้าของเรา คุณสามารถเขียนข้อความนี้ได้ที่หลังร้าน /admin <BR>user:admin password:admin หลังจากนั้นเข้าไปตั้งค่าเว็บไซต์ -&gt;สร้างหมวดสินค้า<BR>-&gt;ใส่สินค้า 1 สินค้าใส่รูปได้ 5 รูป แสดงภาพแบบ HighSlide<BR>เมื่อแล้วเสร็จก็ทดสอบร้านค้า อย่าลืมลบไฟล์ INSTALL.PHP และเปลี่ยนชื่อหลังร้าน<BR>&nbsp;/admin เป็นชื่อใหม่ที่คุณรู้คนเดียว หวังว่าร้านค้าง่ายๆนี้จะมีประโยชน์กับธุรกิจของคุณนะครับ<BR></STRONG></FONT><FONT color=#0000ff><STRONG>Somsak2004<BR>16 ธันวาคม 2551</STRONG></FONT><BR></P>', '<P align=center><STRONG><FONT color=#0000ff size=4>ร้านค้า S-Shop เป็นระบบร้านค้าออนไลน์แบบง่ายๆ ทำขึ้นให้คนไทยใช้ประเทศเดียว</FONT></STRONG><BR><BR>-มีระบบเขียนอักษรแบบ HTML<BR>-มีระบบตรวจสอบรหัสพัสดุ EMS หรือ จดหมายลงทะเบียน ด้วยคลิ๊กเดียว!!!<BR>-มีระบบแจ้งการโอนเงินออนไลน์ด้วยธนาคารในประเทศไทย<BR>-สามารถตรวจสอบสถานะสินค้าแสดงประวัติการจัดส่งการสั่งซื้อได้<BR>-มีระบบสมาชิกให้ด้วย โดยการจดจำข้อมูลครั้งละ 1 ปี/คน<BR>-มีระบบจดหมายข่าวแจ้งให้สมาชิก<BR>-ระบบทำสินค้าโปรโมชั่น!!! สำหรับเน้นการขาย<BR>-ระบบหน้า Contact ให้กับร้านค้า<BR>-ระบบที่อยู่ เก็บข้อมูล จังหวัด-อำเภอ-ตำบล ของประเทศไทย!!!<BR>-เปลี่ยนสถานะของคำสั่งซื้อจะส่งเมล์แจ้งให้ทราบทุกขั้นตอน<BR>-เปลี่ยนโฟลเดอร์ฟลังร้านเป็นอะไรก็ได้เพื่อความปลอดภัย!!<BR>-ระบบแสดงข้อมูลสามารถแบ่งหน้าการแสดงได้<BR>-ใส่ระบบค้นหาสินค้าสำหรับสินค้าจำนวนมากๆ<BR><BR>ทั้งหมดนี้เป็นระบบพื้นฐานของโปรแกรม โดยให้คุณใช้งานได้ปกติ แบบฟรีๆ<BR>หาโปรแกรมนี้ได้ที่เว็บผู้ผลิต <A href="http://www.somsak2004.com">Somsak2004</A></P>', '<P align=center><U><FONT color=#00ff00 size=7><B>ยินดีต้อนรับสู่ S-Shop</B></FONT></U></P>\r\n<P align=left>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ตรงนี้ให้ใส่ข้อตกการชื่อขายของร้านคุณ เช่น<BR><BR>-ต้องโอนเงินก่อนแล้วแจ้งออนไลน์หรือแจ้งทางโทรศัพท์<BR>-สินค้ารับประกัน 7 วัน<BR>-การจัดส่ง หลังรับเงินไม่เกิน 3 วันทำการ<BR><BR>ประมาณนี้หน่ะครับ<BR></P>', 10);
