
CREATE TABLE `amphur` (
  `id` varchar(5) character set utf8 collate utf8_unicode_ci default NULL,
  `provinceID` varchar(3) character set utf8 collate utf8_unicode_ci default NULL,
  `name` text character set utf8 collate utf8_unicode_ci
) ENGINE=MyISAM DEFAULT CHARSET=utf8;




-- --------------------------------------------------------

-- 
-- โครงสร้างตาราง `bank`
-- 

CREATE TABLE `bank` (
  `id` int(3) NOT NULL auto_increment,
  `name_bank` varchar(80) collate utf8_unicode_ci NOT NULL,
  `branch` varchar(80) collate utf8_unicode_ci NOT NULL,
  `account_no` varchar(30) collate utf8_unicode_ci NOT NULL,
  `account_name` varchar(80) collate utf8_unicode_ci NOT NULL,
  `type` varchar(40) collate utf8_unicode_ci NOT NULL,
  KEY `id` (`id`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=1 ;


CREATE TABLE `cat_product` (
  `id` int(4) NOT NULL auto_increment,
  `name` varchar(80) collate utf8_unicode_ci NOT NULL,
  `pic` varchar(100) collate utf8_unicode_ci NOT NULL,
  KEY `id` (`id`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=1 ;


CREATE TABLE `config` (
  `id` tinyint(1) NOT NULL,
  `logo` varchar(50) collate utf8_unicode_ci NOT NULL,
  `metatag` text collate utf8_unicode_ci NOT NULL,
  `metadesc` text collate utf8_unicode_ci NOT NULL,
  `title` varchar(120) collate utf8_unicode_ci NOT NULL,
  `footer` varchar(500) collate utf8_unicode_ci NOT NULL,
  `owner_name` varchar(80) collate utf8_unicode_ci NOT NULL,
  `name_place` varchar(120) collate utf8_unicode_ci NOT NULL,
  `location` varchar(300) collate utf8_unicode_ci NOT NULL,
  `telephone` varchar(40) collate utf8_unicode_ci NOT NULL,
  `email` varchar(50) collate utf8_unicode_ci NOT NULL,
  `username` varchar(50) collate utf8_unicode_ci NOT NULL,
  `password` varchar(50) collate utf8_unicode_ci NOT NULL,
  `cols` int(1) NOT NULL,
  `item` int(3) NOT NULL,
  `welcome` text collate utf8_unicode_ci NOT NULL,
  `home` text collate utf8_unicode_ci NOT NULL,
  `data` text collate utf8_unicode_ci NOT NULL,
  `term` text collate utf8_unicode_ci NOT NULL,
  `ems` int(4) NOT NULL,
  KEY `id` (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;





CREATE TABLE `news` (
  `id` int(4) NOT NULL auto_increment,
  `date_post` date NOT NULL,
  `header` varchar(100) collate utf8_unicode_ci NOT NULL,
  `text` text collate utf8_unicode_ci NOT NULL,
  KEY `id` (`id`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=1 ;


CREATE TABLE `order_data` (
  `id` int(5) NOT NULL auto_increment,
  `id_user` int(5) NOT NULL,
  `date_order` date NOT NULL,
  `date_pay` date NOT NULL,
  `date_sent` date NOT NULL,
  `item` text collate utf8_unicode_ci NOT NULL,
  `price` varchar(10) collate utf8_unicode_ci NOT NULL,
  `status` int(1) NOT NULL,
  `bank` varchar(30) collate utf8_unicode_ci NOT NULL,
  `value` varchar(10) collate utf8_unicode_ci NOT NULL,
  `ems` varchar(13) collate utf8_unicode_ci NOT NULL,
  `comment` text collate utf8_unicode_ci NOT NULL,
  KEY `id` (`id`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=1 ;


CREATE TABLE `product` (
  `id` int(6) NOT NULL auto_increment,
  `id_cat` int(4) NOT NULL,
  `name` varchar(80) collate utf8_unicode_ci NOT NULL,
  `detail` text collate utf8_unicode_ci NOT NULL,
  `promotion` varchar(1) collate utf8_unicode_ci NOT NULL,
  `pic1` varchar(100) collate utf8_unicode_ci NOT NULL,
  `pic2` varchar(100) collate utf8_unicode_ci NOT NULL,
  `pic3` varchar(100) collate utf8_unicode_ci NOT NULL,
  `pic4` varchar(100) collate utf8_unicode_ci NOT NULL,
  `pic5` varchar(100) collate utf8_unicode_ci NOT NULL,
  `price` int(6) NOT NULL,
  `price_pro` int(6) NOT NULL,
  KEY `id` (`id`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=1 ;



CREATE TABLE `province` (
  `id` varchar(3) character set utf8 collate utf8_unicode_ci default NULL,
  `name` text character set utf8 collate utf8_unicode_ci
) ENGINE=MyISAM DEFAULT CHARSET=utf8;





CREATE TABLE `tumbon` (
  `id` varchar(7) character set utf8 collate utf8_unicode_ci default NULL,
  `amphurID` varchar(5) character set utf8 collate utf8_unicode_ci NOT NULL,
  `name` text character set utf8 collate utf8_unicode_ci
) ENGINE=MyISAM DEFAULT CHARSET=utf8;





CREATE TABLE `user` (
  `id` int(5) NOT NULL auto_increment,
  `username` varchar(50) collate utf8_unicode_ci NOT NULL,
  `password` varchar(30) collate utf8_unicode_ci NOT NULL,
  `name` varchar(50) collate utf8_unicode_ci NOT NULL,
  `surname` varchar(80) collate utf8_unicode_ci NOT NULL,
  `x_tel` varchar(30) collate utf8_unicode_ci NOT NULL,
  `email` varchar(30) collate utf8_unicode_ci NOT NULL,
  `address` varchar(50) collate utf8_unicode_ci NOT NULL,
  `condo` varchar(50) collate utf8_unicode_ci NOT NULL,
  `road` varchar(40) collate utf8_unicode_ci NOT NULL,
  `po` varchar(30) collate utf8_unicode_ci NOT NULL,
  `am` varchar(30) collate utf8_unicode_ci NOT NULL,
  `tb` varchar(30) collate utf8_unicode_ci NOT NULL,
  `post` varchar(5) collate utf8_unicode_ci NOT NULL,
  `text` text collate utf8_unicode_ci NOT NULL,
  KEY `id` (`id`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=1 ;
